        private int[][] getMultiDimArray(string arrString)
        {
            arrString = arrString.Trim('[', ']');
            string[] arStrs = arrString.Split("],[");
            int[][] result = new int[arStrs.Length][];
            for (int i = 0; i < arStrs.Length; i++)
            {
                string[] ars = arStrs[i].Split(',');
                result[i] = new int[ars.Length];
                for (int j = 0; j < ars.Length; j++)
                {
                    result[i][j] = int.Parse(ars[j]);
                }
            }
            return result;
        }

        private int[] get2DArray(string arrString)
        {
            arrString = arrString.Trim('[', ']');
            string[] arStrs = arrString.Split(",");
            int[] result = new int[arStrs.Length];
            for (int i = 0; i < arStrs.Length; i++)
            {
                result[i] = int.Parse(arStrs[i]);

            }
            return result;
        }
