        #region 3203. Find Minimum Diameter After Merging Two Trees

        [Test]
        public void MinimumDiameterAfterMergeTest()
        {
            string edgeS1 = "[[0,1]]";
            string edgeS2 = "[[0,1],[0,2],[0,3]]";
            int[][] edges1 = getMultiDimArray(edgeS1);
            int[][] edges2 = new int[0][];
            var k = leetcode.MinimumDiameterAfterMerge(edges1, edges2);
            Assert.AreEqual(2, k);
        }

        [Test]
        public void MinimumDiameterAfterMergeTest3()
        {
            string edgeS1 = "[[0,1],[2,0],[3,2],[3,6],[8,7],[4,8],[5,4],[3,5],[3,9]]";
            string edgeS2 = "[[0,1],[0,2],[0,3]]";
