            int[][] edges2 = getMultiDimArray(edgeS2);
            var k = leetcode.MinimumDiameterAfterMerge(edges1, edges2);
            Assert.AreEqual(7, k);
        }

        [Test]
        public void MinimumDiameterAfterMergeTest2()
        {
            string edgeS1 = "[[1,0],[2,3],[1,4],[2,1],[2,5]]";
